	@Test
	public void runningImportJobDirectlyShouldProduceResult() throws Throwable {

		final String resTableName = "knimeTab1";
		String jobId = importTestTable(CONTEXT_ID, TEST_TABLE, resTableName);

		// result is serialized as a string
		assertFalse("job should not be running anymore",
				JobStatus.OK.equals(JobControler
						.getJobStatus(CONTEXT_ID, jobId)));

		checkResult(CONTEXT_ID, resTableName);
	}

	@Test
	public void utilShouldHandelNullAndOtherSpecialValuesInTable()
			throws Throwable {
		final Object[][] inputData = new Object[][] {
				new Object[] { 1, true, "", " ", null },
				new Object[] { 2, false, "a", " b ", null },
				new Object[] { 2, false, "a\n\r", " b   \"^´`' +*", 5.678d } };
		final String resTableName = "knimeTab1";
		String jobId = importTestTable(CONTEXT_ID, inputData, resTableName);
		JobControler.waitForJobAndFetchResult(CONTEXT_ID, jobId, null);

		// now check result:
		final String jsonParams = rowFetcherDef(10, resTableName);

		String takeJobId = JobControler.startJob(CONTEXT_ID,
				FetchRowsJob.class.getCanonicalName(), jsonParams);
		JobResult res = JobControler.waitForJobAndFetchResult(CONTEXT_ID,
				takeJobId, null);
		assertNotNull("row fetcher must return a result", res);

		Object[][] arrayRes = (Object[][]) res.getObjectResult();

		assertEquals("unexpected number of rows", inputData.length,
				arrayRes.length);
		for (int ix = 0; ix < inputData.length; ix++) {
			final Object[] inputRow = inputData[ix];
			final Object[] outputRow = arrayRes[ix];
			assertTrue("column type must not change (Col 0)",
					outputRow[0] instanceof Integer);
			assertTrue("column type must not change (Col 1)",
					outputRow[1] instanceof Boolean);
			assertTrue("column type must not change (Col 2)",
					outputRow[2] instanceof String);
			assertTrue("column type must not change (Col 3)",
					outputRow[3] instanceof String);
			assertTrue("column type must not change (Col 4): " + outputRow[4],
					outputRow[4] == null || outputRow[4] instanceof Double);
			for (int colIx = 0; colIx < inputRow.length; colIx++) {
				assertEquals("unexpected cell value", inputRow[colIx],
						outputRow[colIx]);
			}
		}
	}

